window.bookSummaryJSON = "<p>After the Delphi League defeats the Fazullan invasion of Onisiwo, Catie is tasked with managing the Onisiwoen transition to the Delphi League, as well as the repatriation of all the slaves from the Fazullan fleet. She has to navigate the complex diplomatic circles, as different interests complete for advantage in the new age of interstellar trade.</p>"; 
